import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the "Shop now" button to open the product detail modal
    await page.waitForSelector('.cta-button');
    await page.click('.cta-button');
    await page.waitForLoadState('networkidle');

    // Take screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_opened.png'));

    // Verify modal content
    const modalVisible = await page.isVisible('.modal-content');
    const modalTitle = await page.textContent('.product-detail-title');

    return {
      success: true,
      action: "Opened product detail modal and verified content",
      extractedData: {
        modalVisible,
        modalTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
